import React from 'react';
import { useTranslation } from '../context/LanguageContext';
import './homeStyles.css';

const Home = () => {
  const { t } = useTranslation();

  return (
    <div className="home_unique_wrapper">

      {/* WhatsApp Button */}
      <a href="https://api.whatsapp.com/send?phone=9160606108&text=Hi%20Enquiry%20from%20Alavi" className="float1" target="_blank" rel="noopener noreferrer">
        <i className="fa fa-whatsapp my-float"></i>
      </a>

      {/* Social Media Sidebar */}
      <div className="icon-bar">
        <a href="https://www.facebook.com/alavihosp/" target="_blank" rel="noopener noreferrer" className="facebook"><i className="fa fa-facebook"></i></a>
        <a href="https://www.linkedin.com/in/alavi-hospitals-7a1b2a322/" target="_blank" rel="noopener noreferrer" className="linkedin"><i className="fa fa-linkedin"></i></a>
        <a href="https://www.instagram.com/alavihospitals/" target="_blank" rel="noopener noreferrer" className="instagram"><i className="fa fa-instagram"></i></a>
        <a href="#" target="_blank" rel="noopener noreferrer" className="twitter"><i className="fa fa-twitter"></i></a>
        <a href="#" target="_blank" rel="noopener noreferrer" className="youtube"><i className="fa fa-youtube"></i></a>
      </div>

      {/* Header Section */}
      <header className="header-area">
        <div className="header-top">
          <div className="container">
            <div className="row">
              <div className="col-lg-9 d-md-flex">
                <h6><i className="fa fa-map-marker mr-2"></i>12, 234, Adarsh Nagar, Adjeetpura Nagar, Opp:, IDPL Colony, Balanagar</h6>
                <h6 className="ml-3">
                  <i className="fa fa-mobile mr-2"></i>
                  <a href="tel:9160606108">9160 606 108</a> / <a href="tel:04049994949">040-49 99 49 49</a>
                </h6>
              </div>
              <div className="col-lg-3">
                <div className="social-links">
                  <ul>
                    <li><a href="https://www.facebook.com/alavihosp" target="_blank" rel="noopener noreferrer"><i className="fa fa-facebook"></i></a></li>
                    <li><a href="https://www.linkedin.com/in/alavi-hospitals-7a1b2a322/" target="_blank" rel="noopener noreferrer"><i className="fa fa-linkedin"></i></a></li>
                    <li><a href="#" target="_blank" rel="noopener noreferrer"><i className="fa fa-twitter"></i></a></li>
                    <li><a href="#" target="_blank" rel="noopener noreferrer"><i className="fa fa-youtube"></i></a></li>
                  </ul>
                </div>
              </div>
            </div>
          </div>
        </div>
      </header>

      {/* Carousel Section */}
      <section className="home_unique_carousel">
        <div id="demo" className="carousel slide" data-bs-ride="carousel">
          <div className="carousel-indicators">
            <button type="button" data-bs-target="#demo" data-bs-slide-to="0" className="active"></button>
            <button type="button" data-bs-target="#demo" data-bs-slide-to="1"></button>
            <button type="button" data-bs-target="#demo" data-bs-slide-to="2"></button>
          </div>
          <div className="carousel-inner">
            <div className="carousel-item active">
              <img src="assets/images/banner.jpg" alt="Banner 1" className="d-block w-100 mt-4" />
            </div>
            <div className="carousel-item">
              <img src="assets/images/banner-2.jpg" alt="Banner 2" className="d-block w-100 mt-4" />
            </div>
            <div className="carousel-item">
              <img src="assets/images/banner-3.jpg" alt="Banner 3" className="d-block w-100 mt-4" />
            </div>
          </div>
        </div>
      </section>

      {/* Feature Section */}
      <section className="feature-area section-padding">
        <div className="container">
          <div className="row">
            {[
              {
                img: "assets/images/feature1.png",
                title: "Personalized Treatment Plans",
                desc: "We craft individualized care plans tailored to your specific medical needs, ensuring the best outcomes for every patient."
              },
              {
                img: "assets/images/feature2.png",
                title: "Collaborative Care Teams",
                desc: "Our multidisciplinary team works together to provide seamless care, supporting you at every stage of your health journey."
              },
              {
                img: "assets/images/feature3.png",
                title: "Innovation in Healthcare",
                desc: "We stay at the forefront of medical advancements, utilizing the latest innovations to deliver effective, safe, and cutting-edge treatments."
              }
            ].map((feature, idx) => (
              <div className="col-lg-4 col-md-6 mt-4" key={idx}>
                <div className="single-feature text-center item-padding">
                  <img src={feature.img} alt={feature.title} />
                  <h3>{feature.title}</h3>
                  <p className="pt-3">{feature.desc}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Welcome Section */}
      <section className="welcome-area section-padding3">
        <div className="container">
          <div className="row">
            <div className="col-lg-5 align-self-center">
              <img src="assets/images/welcome.png" alt="Welcome" className="welcome-img" />
            </div>
            <div className="col-lg-7">
              <div className="welcome-text mt-5 mt-lg-0">
                <h1>Hyderabad’s Trusted Multispecialty Hospital</h1>
                <p className="pt-3">
                  Founded in March 2024, Alavi Multi Speciality Hospital (formerly Kodali Hospital) offers expert care in women’s health, Paediatrics, and a wide range of medical fields...
                </p>
                <a href="about.html" className="template-btn mt-3">Learn More</a>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Department Section */}
      <section className="department-area section-padding4">
        <div className="container">
          <div className="row">
            <div className="col-lg-6 offset-lg-3 text-center">
              <h2>We Provide State-of-the-Art Treatment, in various directions</h2>
            </div>
          </div>
          <div className="row department-slider">
            {/* Example static entries; replace with .map if dynamic */}
            {[
              { img: "assets/images/ped-img.jpg", title: "Paediatric", desc: "Comprehensive care for infants, children, and teens..." },
              { img: "assets/images/ort-img.jpg", title: "Orthopedics", desc: "Expert orthopedic care for bones, joints..." },
              { img: "assets/images/car-img.jpg", title: "Cardiology", desc: "Advanced heart care with diagnostics..." },
              { img: "assets/images/gyn-img.jpg", title: "Gynaecology & Obstetrics", desc: "Personalized care for women’s health..." }
            ].map((dept, idx) => (
              <div className="single-slide" key={idx}>
                <div className="slide-img">
                  <img src={dept.img} alt={dept.title} className="img-fluid" />
                </div>
                <div className="single-department item-padding text-center">
                  <h3>{dept.title}</h3>
                  <p>{dept.desc}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Patient Area */}
      <section className="patient-area section-padding">
        <div className="container">
          <div className="row">
            <div className="col-lg-6 offset-lg-3 text-center">
              <h2>Patient are saying</h2>
            </div>
          </div>
          <div className="row">
            <div className="col-lg-5">
              <div className="single-patient mb-4">
                <h5>Specialized health needs.</h5>
                <h2>More Pediatric Specialists, Strong Partnerships, and The Power to Care Your Child's</h2>
                <p className="pt-5">OR CALL:<br />
                  <h3>9160 606 108<br />040-49 99 49 49</h3>
                </p>
              </div>
            </div>
            <div className="col-lg-5 offset-lg-1 align-self-center">
              <div className="appointment-form text-center mt-5 mt-lg-0">
                <h3 className="mb-5">Appointment Now</h3>
                <form action="#" method="POST">
                  <div className="form-group">
                    <input type="text" name="name" placeholder="Your Name" required />
                  </div>
                  <div className="form-group">
                    <input type="email" name="email" placeholder="Your Email" required />
                  </div>
                  <div className="form-group">
                    <textarea name="message" placeholder="Your Message" required></textarea>
                  </div>
                  <button type="submit" className="template-btn">Submit</button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </section>

    </div>
  );
};

export default Home;
